import React from 'react';
import {
    Container, Content
} from "./Styled.js";

export default class DisplayContext extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div>
                <Container width={(window.innerWidth - 480).toString() + 'px'}>
                    <Content/>
                </Container>
            </div>
        )
    }
}
